    public async Task CalAmount(PRItem context)
    {
        float rate = context.ExRate != null ? context.ExRate : 1;
        context.Amount = context.Quantity * context.Price_PR;
        context.AmountTHB = context.Amount * rate;
        this.StateHasChanged();
    }



